var vueCommon=new Vue({el:"#vueCommon",data:{},methods:{hidePhoneNumber:function(d){var c=d.split("-");if(c.length===2){return c[0]+"-****"}else{if(c.length===3){return c[0]+"-"+c[1]+"-****"}}return d},checkPhoneNumberType:function(g){var f=g.replace(/[^0-9]/g,"");var h=f.length;var e="";if(h<7){return g}else{if(h===7){e+=f.substr(0,3);e+="-";e+=f.substr(3,4);return e}else{if(h===8){console.log("digit 8 "+f);e+=f.substr(0,4);e+="-";e+=f.substr(4,8);return e}else{if(h===9){e+=f.substr(0,2);e+="-";e+=f.substr(2,3);e+="-";e+=f.substr(5,9);return e}else{if(h===10){if(f.substr(0,2)==="02"){e+=f.substr(0,2);e+="-";e+=f.substr(2,4);e+="-";e+=f.substr(6,4);return e}else{console.log("digit 10 and !02 "+f);e+=f.substr(0,3);e+="-";e+=f.substr(3,3);e+="-";e+=f.substr(6,4);return e}}else{if(h===11){e+=f.substr(0,3);e+="-";e+=f.substr(3,4);e+="-";e+=f.substr(7,4);return e}}}}}}},separateMemo:function(o,r,p){if(o===null||o===""){return"<div class='center'>-</div>"}var n=o.split("{}");var q=r.split("{}");var i=p.split("{}");var v="";for(var s=0,m=n.length;s<m;s++){var o=n[s];var u=q[s];var t=i[s];v+="<div>"+u+" <i class='fa fa-arrow-circle-o-right'></i> "+o;v+="<small>("+t+")</small>";v+="</div>"}return v},extractDateFromDateTime:function(b){if(b){return new moment(b).format("YYYY-MM-DD")}return"날짜없음"}}});